
With HBV being endemic in China and Southeast Asia, and high levels of HCC being a result, the ACRG have studied the events and effects of HBV integration in the HCC genome.  To do this massively parallel sequencing in a cohort of 88 Chinese patients diagnosed with HCC who underwent curative primary hepatectomy or liver transplantation at Queen Mary Hospital (Pokfulam, Hong Kong) was carried out.  All patients gave written informed consent to use both tumor (T) and non-tumor (N) liver tissues for the study.

Genomic DNA was purified for at least 30-fold coverage paired-end (PE) sequencing, and PE reads were mapped on human reference genome (UCSC build hg19) and HBV (<a href="http://www.ncbi.nlm.nih.gov/nuccore/NC_003977">NC_003977</a>).  Two sequencing libraries with different insert size were constructed for each genomic DNA sample (200 bp and 800 bp).  Paired end, 90bp read length sequencing was performed in the HiSeq 2000 sequencer according to Manufacturerâ€™s instructions. Raw gene expression profiling data of these human HCC samples has also deposited to GEO with the accession number <a href="http://www.ncbi.nlm.nih.gov/geo/query/acc.cgi?acc=GSE25097">GSE25097</a>.', 0, 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100034/', 'Published', 'GigaDBUploadForm_Cancer.xls', '35595d43250b07a8591450924410e454', '2012/05/31', '2012/6/22', 1 );
